import React, { Component } from 'react';
import Button from 'react-bootstrap/Button'
import '../../default.css';
import Accordion from 'react-bootstrap/Accordion';
import { useAccordionToggle } from 'react-bootstrap/AccordionToggle';
import Card from 'react-bootstrap/Card'

class InformationSession extends Component {
    render() {
        return (
            <div className="container-fluid faq">
                <div className="row">
                    <div>
                        <text className="h1 row-heading"> Host an Information Session </text>
                        <p> Can't find the answer you're looking for?
                            We've shared some of our frequently asked questions to help you out!</p>
                    </div>
                </div>
            </div>
        );
    }
}

export default InformationSession;
